('cmcjdi5z5001213b162mnen2g', 'cmc0apnf90038qoublubz4128', ' Wireless Charging on the Moon Becomes Reality', 'Astrobotic and WiBotic have completed flight-ready tests of the world''s first wireless charging system for lunar missions. The device transfers power from a base station to rovers via magnetic coils ‚Äî no cables needed. Developed in partnership with NASA, Bosch, and the University of Washington.\\n\\nThe system is built to survive extreme conditions: cold, dust, vacuum, and launch vibrations. It''s a step toward a universal power standard for Moon and Mars missions.\\nIt won''t fly with the upcoming Griffin lander but is being prepared for future launches.\\n\\nFunded by NASA. A 125-watt version is already available; a 400-watt upgrade is in development.', 'image', 'Tech', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/images/thumb_f1114009bef21dc8943bceca5684fb61.webp', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/f1114009bef21dc8943bceca5684fb61.jpg', false, false, NULL, 'SOL', 3, 0, 0, UPDATED_AT_PLACEHOLDER),,

