('cmci4ntsh0009df0g33gl9b8e', 'cmc27qyl10001qoic6jb7dax6', 'Be your selfüì∑üíå', '–ë—ã—Ç—å —Å–æ–±–æ–π ‚Äî —ç—Ç–æ –ø—Ä–æ—è–≤–ª—è—Ç—å —Å–≤–æ—é —É–Ω–∏–∫–∞–ª—å–Ω–æ—Å—Ç—å –∏ –Ω–µ –±–æ—è—Ç—å—Å—è –æ—Ç–ª–∏—á–∞—Ç—å—Å—è –æ—Ç –¥—Ä—É–≥–∏—Ö. –ù–µ –ø—Ä—è—á—å —Å–≤–æ–∏ —á—É–≤—Å—Ç–≤–∞ –∏ –º—ã—Å–ª–∏ —Ä–∞–¥–∏ —á—É–∂–∏—Ö –æ–∂–∏–¥–∞–Ω–∏–π: —Ç–≤–æ—è –∏—Å–∫—Ä–µ–Ω–Ω–æ—Å—Ç—å –ø—Ä–∏—Ç—è–≥–∏–≤–∞–µ—Ç —Å–∞–º—ã—Ö –Ω–∞—Å—Ç–æ—è—â–∏—Ö –ª—é–¥–µ–π, –∞ —Ç–≤–æ—è –∏–Ω–¥–∏–≤–∏–¥—É–∞–ª—å–Ω–æ—Å—Ç—å –¥–µ–ª–∞–µ—Ç –º–∏—Ä –∏–Ω—Ç–µ—Ä–µ—Å–Ω–µ–µ. –ü–æ–∑–≤–æ–ª—å —Å–µ–±–µ –±—ã—Ç—å —Ç–µ–º, –∫—Ç–æ —Ç—ã –µ—Å—Ç—å, ‚Äî –≤–µ–¥—å –∏–º–µ–Ω–Ω–æ —Ç–∞–∫ —Ç—ã –ø–æ-–Ω–∞—Å—Ç–æ—è—â–µ–º—É —Å—á–∞—Å—Ç–ª–∏–≤ –∏ —Å–≤–æ–±–æ–¥–µ–Ω!‚ú®‚ù§', 'image', 'Intimate', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/images/thumb_4d30d0a6fd0db95446fcde5251e96b92.webp', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/4d30d0a6fd0db95446fcde5251e96b92.jpg', true, false, NULL, 'SOL', 1, 0, 0, UPDATED_AT_PLACEHOLDER),,

('cmchwpgiq000514n35f93vvfs', 'cmbvtqy84000gqowpvlo2r5tp', 'Mercedes Extends the Life of Combustion Engines', 'Mercedes-Benz has changed its strategy: the company will no longer completely abandon internal combustion engines (ICEs) by 2030, as previously planned. Instead, the brand will continue to develop electrified gasoline and diesel engines, including hybrids.\\n\\nCompany CEO Ola K√§llenius explained this by pointing to the slowing growth of the electric vehicle (EV) market. Although EV sales continue to grow, the pace has been significantly below expectations. Therefore, Mercedes has decided not to rely solely on electric power, but to maintain a flexible approach.\\n\\nThis kind of course correction is now being observed among nearly all major automakers that had earlier announced a full phase-out of ICEs. The reason is simple: electric cars have not become affordable or accessible, and after the removal of government subsidies in many countries, they''ve become even more expensive than traditional cars. As a result, actual consumer demand has proven weaker than projected.\\n\\nMoreover, automakers have already invested billions into the development of electric vehicles‚Äîincluding batteries, platforms, and new production lines. However, a full transition to EVs has not been successful, and now, in order not to write off those investments as losses, companies are turning to hybrid solutions. This allows them to use already-developed technologies (batteries, software, architecture) in combination with ICEs and at least partially recover the costs.\\n\\nAs a result, the focus is increasingly shifting toward hybridization as the most realistic and commercially viable path under current market conditions.\\n\\nDespite this, Mercedes‚Äîlike BMW and Audi‚Äîwill continue to produce electric vehicles alongside ICE models at least through the mid-2030s, adapting to regulations in different countries.', 'image', 'Tech', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/images/thumb_b072f28d4f42f5c115ef7bf23497dbe2.webp', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/b072f28d4f42f5c115ef7bf23497dbe2.webp', false, false, NULL, 'SOL', 3, 0, 0, UPDATED_AT_PLACEHOLDER),,

