('cmchv6pgs001nts9kajptffi0', 'cmc0apnf90038qoublubz4128', 'Mj√∂lnir: 3D-Printed Rocket Engine by New Frontier Aerospace', 'U.S.-based New Frontier Aerospace has successfully tested its new 3D-printed rocket engine, named Mj√∂lnir. Powered by liquefied natural gas (LNG), the engine is designed for hypersonic drones and orbital vehicles.\\n\\nIt has passed a series of hot-fire tests and will power the Pathfinder drone during its first flight, planned for 2026. The engine is also set to be used on the Bifr√∂st orbital transfer vehicle, with a launch targeted for 2027.\\n\\nThe project is backed by NASA and the Department of Defense (via NSIC), with over $2.5 million in funding. Mj√∂lnir is also being offered to other aerospace companies as a standalone product.\\n\\nAccording to the developers, the engine combines compactness, efficiency, and eco-friendliness, marking a new step for hypersonic and spaceflight technologies.', 'image', 'Tech', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/images/thumb_971935acbd2409942aac047b85478616.webp', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/971935acbd2409942aac047b85478616.jpg', false, false, NULL, 'SOL', 3, 0, 0, UPDATED_AT_PLACEHOLDER),,

