('cmcfyxmbb005rwsr9o6ru9ka1', 'cmc0apnf90038qoublubz4128', 'Google brings historical Street View to Google Earth', 'To celebrate its 20th anniversary, Google has added historical Street View imagery to Google Earth. Users can now see how streets and buildings have changed over the years by jumping between time periods ‚Äî a feature previously available only in Google Maps.\\n\\nThe company also announced new AI tools for urban planning, including vegetation analysis, surface temperature mapping, and hotspot detection in cities.\\n\\nGoogle Earth continues to evolve, with over 2 billion searches performed worldwide in the past year alone.', 'image', 'Tech', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/images/thumb_096b7d606c9aaf6a5175c9eea3f1edf9.webp', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/096b7d606c9aaf6a5175c9eea3f1edf9.png', false, false, NULL, 'SOL', 1, 0, 0, UPDATED_AT_PLACEHOLDER),,

