('cmcfy00e3003ywsr98rpx49ke', 'cmbvtqy84000gqowpvlo2r5tp', 'How Ford Won Le Mans: The Story of the GT40', 'In 1966, Ford rewrote motorsport history when its GT40 team took the top three spots at the legendary 24 Hours of Le Mans, ending Ferrari''s six-year winning streak.\\n\\nIt all began with Henry Ford II''s ambition to take revenge on Ferrari after a failed deal to buy the company. In response, Ford invested millions into developing the GT40 supercar and brought in top talent like Carroll Shelby and Ken Miles.\\n\\nAfter setbacks in 1964‚Äì65, Ford returned in 1966 with an improved GT40 Mk II powered by a mighty 7-liter V8. The cars showed incredible endurance and speed.\\n\\nThe finish was iconic: three Fords crossed the line together, symbolizing total dominance. This marked the beginning of Ford''s four-year winning streak at Le Mans from 1966 to 1969.\\n\\nIt was also a historic first ‚Äî Ford became the first American car manufacturer to win Le Mans overall, with an all-American chassis, engine, and team. Until then, no American brand had ever conquered the French endurance race. Ford didn''t just win ‚Äî it made a statement that echoed through racing history.', 'image', 'Tech', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/images/thumb_7e98ccb19469b59ea57c6aa4eeb98372.webp', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/7e98ccb19469b59ea57c6aa4eeb98372.jpeg', false, false, NULL, 'SOL', 1, 0, 0, UPDATED_AT_PLACEHOLDER),,

